INSERT INTO `cadrelatorios` VALUES (1,'ServIP','select \r\n  cis.chave as CI, \r\n  tipocis.tipo,\r\n  statuscis.status,\r\n  left(cis.descricao,30) as Descricao,\r\n  sites.nome as Site, \r\n  atributos.valor as IP \r\nfrom cis, \r\n  atributos,\r\n  sites,\r\n  tipocis,\r\n  statuscis\r\n\r\nwhere \r\n   (atributos.dicdado_id = 6 or atributos.dicdado_id=10) and \r\n    atributos.ci_id = cis.id and \r\n    cis.site_id = sites.id and \r\n    cis.tipoci_id = tipocis.id and\r\n    cis.statusci_id = statuscis.id\r\n\r\n\r\norder by atributos.valor;\r\n\r\n\r\n','2013-04-18 01:03:13','2013-11-04 12:11:14','Serv Virtuais e IPs'),(2,'AlertasCWBGestor','select  \r\n  sites.nome as Site,\r\n  categories.name as \"Cliente\",\r\n  DATE_FORMAT(tasks.created_at, \'%d-%m\')  as \"Criando em \",\r\n  status as Status,\r\n\r\n  tipotask as tipo,\r\n  fornecedores.nome as Fornecedor, \r\n  concat(tasks.nome,\"-\",tasks.description) as Alerta \r\nfrom \r\n   tasks,\r\n   fornecedores,\r\n   sites,\r\n   categories\r\nwhere site_id in (1,4,7) and \r\n   publica and \r\n   fornecedores.id = tasks.fornecedor_id and \r\n   categories.id = tasks.category_id and\r\n   sites.id = tasks.site_id and \r\n   tasks.ativo=1','2013-04-19 13:55:28','2013-10-22 13:37:05','Todos os links com custo mensal'),(3,'TodosLinks','Select contratos.codcontrato as Codigo ,left(fornecedores.nome,20) as Fornecedor, FORMAT(contratos.valormensal,0) as \"Valor Mensal\" from contratos, fornecedores where tipocontrato_id=3 and contratos.fornecedor_id = fornecedores.id\r\norder by fornecedor\r\n','2013-05-20 17:26:32','2013-10-30 13:37:31','Links BRQ com operadora e custo mensal'),(4,'EmMudanca','select cis.chave as CI, statuscis.status as Status, tipocis.tipo,cis.descricao as Descricao from cis, statuscis,tipocis where \r\ncis.statusci_id in(3,4,6) and cis.tipoci_id = tipocis.id \r\nand cis.statusci_id = statuscis.id','2013-06-10 13:29:12','2013-06-10 13:34:52',NULL),(5,'ServidoresXServicos','select\r\n        cis.chave as CI,\r\n        left(cis.descricao ,30) as Descricao,\r\n        MAX(IF(atributos.dicdado_id = 9, atributos.valor, NULL)) as Servicos ,\r\n\r\n        MAX(IF(atributos.dicdado_id = 6 , atributos.valor, NULL)) as IP\r\n  \r\n    from\r\n        cis,\r\n        atributos,\r\n        sites,\r\n        tipocis\r\n     where\r\n        cis.tipoci_id=32 and\r\n        atributos.ci_id = cis.id and\r\n        cis.site_id = sites.id and\r\n        cis.tipoci_id = tipocis.id\r\n      group by\r\n        cis.chave\r\n      order by\r\n        cis.chave;','2013-06-14 14:24:29','2013-11-01 19:07:36',''),(6,'Links','select\r\n        cis.chave as CI,\r\n        cis.descricao as Descricao,\r\n        MAX(IF(atributos.dicdado_id = 3, atributos.valor, NULL)) as Designacao \r\n    from\r\n        cis,\r\n        atributos,\r\n        \r\n        tipocis\r\n     where\r\n        cis.tipoci_id=14 and\r\n        atributos.ci_id = cis.id and\r\n        \r\n        cis.tipoci_id = tipocis.id\r\n       \r\n      group by\r\n        cis.chave\r\n      order by\r\n        Designacao;\r\n\r\n# cis.descricao like \'%level3%\' and','2013-06-19 18:33:10','2013-11-01 14:17:57','Links com designacao'),(7,'Contratos','select \"Codigo Contrato,Descricao,Data Inicio,Data Fim,Data Renovacao, Projeto CC TI, Projeto CC Area, Classificacao, Nome Fornecedor, Tipo Contrato\" union \r\nselect convert(concat_ws(\',\',c.codcontrato, \r\nifnull( c.descricao,\'\'),  \r\nifnull( c.datainicio,\'\'),  \r\nifnull( c.datafim,\'\'),  \r\nifnull( c.datarenovacao,\'\'), \r\nifnull( c.projetoCCTI,\'\'), \r\nifnull( c.projetoCCArea,\'\'),  \r\nifnull( c.classificacao,\'\') ,\r\nifnull( f.nome,\'\'),\r\nifnull( tc.descricao, \'\')\r\n) using utf8)\r\nfrom contratos c, fornecedores f,tipocontratos tc where c.tipocontrato_id = tc.id and c.fornecedor_id = f.id;','2013-07-16 16:10:51','2013-10-22 13:54:11','relação de todos os contratos'),(8,'Alertas_BV_VO','select  \r\n  sites.nome as Site,\r\n  categories.name as \"Cliente\",\r\n  DATE_FORMAT(tasks.created_at, \'%d-%m\')  as \"Criando em \",\r\n  status as Status,\r\n\r\n  tipotask as tipo,\r\n  fornecedores.nome as Fornecedor, \r\n  concat(tasks.nome,\"-\",tasks.description) as Alerta \r\nfrom \r\n   tasks,\r\n   fornecedores,\r\n   sites,\r\n   categories\r\nwhere site_id in (1,2,5) and \r\n   publica and \r\n   fornecedores.id = tasks.fornecedor_id and \r\n   categories.id = tasks.category_id and\r\n   sites.id = tasks.site_id and \r\n   tasks.ativo=1','2013-08-09 15:05:24','2013-08-09 15:09:07',''),(9,'Links cristiano','Select \r\n  cis.descricao, \r\n  sites.nome, \r\n    MAX(IF(atributos.dicdado_id = 1, atributos.valor, NULL)) as Banda\r\n\r\nfrom cis , sites, atributos\r\nwhere  \r\n \r\n owner like \'%cristiano%\' and\r\n cis.site_id = sites.id and\r\n atributos.ci_id = cis.id and\r\n cis.tipoci_id=14\r\n\r\n\r\n\r\n','2013-08-21 19:27:04','2013-08-21 19:45:51',''),(11,'Contratos de lInks','Select \r\n   contratos.codcontrato as Contrato,\r\n   fornecedores.nome as Fornecedor, \r\n   cast(contratos.valormensal as char) as valor\r\nfrom \r\n   contratos, \r\n   fornecedores \r\nwhere \r\n   tipocontrato_id=3 and \r\n   contratos.fornecedor_id = fornecedores.id\r\n\r\norder by fornecedores.nome;','2013-09-03 15:56:02','2013-09-30 18:02:18','Valor dos links pelos contratos'),(12,'CustoContratos','select \r\n   cast(sum(customensal) as char) as \"Custo Total por CI\",\r\n   cast(sum(contratos.valormensal) as char) as \"Custo total por contrato\", \r\n   fornecedores.nome As Fornecedor \r\nfrom \r\n   cis, \r\n   contratos, \r\n   fornecedores \r\nwhere \r\n   cis.contrato_id = contratos.id and \r\n   contratos.fornecedor_id = fornecedores.id \r\ngroup by \r\n   fornecedores.nome\r\n\r\n\r\nUNION\r\n\r\nselect \r\n   \"=====================\",\r\n   \"=====================\",\r\n   \"=====================\"\r\n\r\nUNION\r\n\r\nselect \r\n   cast(sum(customensal) as char) as CustoTotalCI,\r\n   cast(sum(contratos.valormensal) as char) as CustoTotalContrato, \r\n   \"TOTAL\" As Fornecedor \r\nfrom \r\n   cis, \r\n   contratos, \r\n   fornecedores \r\nwhere \r\n   cis.contrato_id = contratos.id and \r\n   contratos.fornecedor_id = fornecedores.id ','2013-09-06 14:11:16','2013-09-06 14:31:35','Custo total por fornecedor'),(13,'Fornecedores',' select nome, endereco, contatos, anotacoes, enderecos from fornecedores;','2013-10-22 14:17:44','2013-10-22 14:17:44',''),(14,'CIsAlterados','select\r\n        cis.chave as CI,\r\nowner as Email,\r\n        left(cis.descricao ,30) as Descricao,\r\n        DATE_FORMAT(updated_at , \'%d-%M-%y - %T\') as \"Ultima Alteracao\"\r\n    from\r\n        cis\r\n      order by\r\n        updated_at desc;','2013-11-01 21:00:03','2013-11-04 21:08:37','Relatorio dos ultimos CIs alterados'),(15,'ServidoresInativos','select \r\n  cis.chave as CI, \r\n  tipocis.tipo,\r\n  statuscis.status,\r\n  left(cis.descricao,30) as Descricao,\r\n  sites.nome as Site, \r\n  atributos.valor as IP \r\nfrom cis, \r\n  atributos,\r\n  sites,\r\n  tipocis,\r\n  statuscis\r\n\r\nwhere \r\n   (atributos.dicdado_id = 6 or atributos.dicdado_id=10) and \r\n    atributos.ci_id = cis.id and \r\n    cis.site_id = sites.id and \r\n    cis.tipoci_id = tipocis.id and\r\n    cis.statusci_id = statuscis.id and\r\n    cis.statusci_id <> 1\r\n\r\n\r\norder by atributos.valor;','2013-11-04 12:14:05','2013-11-04 12:14:05','Servidores nao ativos'),(16,'OwnerErrado','select \r\nchave as CI,\r\nOwner \r\nfrom cis \r\nwhere owner like \'%@brq%\' or owner is null or owner=\'\'\r\norder by owner desc','2013-11-04 13:58:39','2013-11-04 14:01:45','Relacao de CI com Owner incorreto'),(18,'CI com IP duplicado','select \r\n  cast(ci_id as char) as CI\r\nfrom \r\n  atributos \r\nwhere valor in (\r\n            select \r\n                valor \r\n            from \r\n                atributos \r\n            where  (atributos.dicdado_id = 6 or atributos.dicdado_id=10) and valor <> \"\" and valor is not null group by valor having count(*) > 1) ','2013-11-04 15:15:24','2013-11-04 15:50:57','ATENCAO: relatorio lento. Nao execute sempre');
