r\nSeguiremos monitorando o ambiente\r\n--------------------------------------------------------\r\n\r\n12/07/2013 - 09:15Hs - abertura de reclamação junto à anatel.\r\n-----------------------------------------------------------\r\n12/07/2013 - 09:10Hs - Novo chamado de cobrança efetuado, Operadora informa que o reparo está sendo efetuado, o circuito inteiro está sendo renovado para evitar problemas futuros, pois trata-se de um circuito antigo. \r\n-----------------------------------------------------------\r\n\r\n11/07/2013  19:00h - Escalonado para a nossa Gerente de contas solicitando maiores informações e uma estimativa para solução do problema.\r\n------------------------------------------------------\r\nOperadora informou que a causa é uma falha massiva devido ao rompimento de fibra óptica afetando toda a região do Nordeste, seguimos em contato junto a operadora em busca da normalização do serviço.\r\n------------------------------------------------------------\r\nIndisponibilidade para efetuar e receber chamadas.\r\n\r\nUm chamado já foi aberto junto à mantenedora.','Normalizado',23,1,5,8,'2013-07-11 11:39:30','2013-07-17 22:20:09',0,NULL,'','[Indisponibilidade Telefonia Fortaleza]',47,'16356 1973200 1973389 1973863',1,'Incidente',NULL,'Instant - 16356\r\n\r\nTim/Intelig - 1973200 1973389 1973863\r\nNova cobrança: 1974093\r\n\r\nProtocolo Anatel - 21529582013',NULL,NULL),(802,'16:05h apresentou falha informado pelo Check-List;\r\n\r\n10:26Hs Serviço Normalizado\r\n\r\nEstamos com indisponibilidade no tronco Marechal 2.\r\n\r\nUm chamado já foi aberto junto à mantenedora e aguardamos um feedback da mesma.','Normalizado',23,1,5,4,'2013-07-11 12:22:18','2013-07-16 19:55:42',0,NULL,'','[Indisponibilidade] Tronco Mal2. Homologação 041 3090-3750]',47,'16357',1,'Incidente',NULL,'',NULL,NULL),(803,'Informamos que hoje, 12/07 entre 18:30 e 19:30, será feita  uma manutenção nos servidor de RM e isso irá paralisar o serviço.\r\n\r\nSerão feitos testes na parte de licenciamento do RM, no Hardlock. \r\n\r\nEssa manutenção será feita pelos analista abaixo.\r\n\r\nRM: Marcelo Garcia EMail:msgouza@brq.com Ramal:8900\r\nData Center: Darci Farias Email:dfarias@brq.com Ramal:9897\r\n','Resolvido',23,1,5,1,'2013-07-12 14:01:11','2013-07-16 19:54:19',0,NULL,'','[Manutenção Servidor RM]',47,'',1,'Info',NULL,'',NULL,NULL),(804,'A MPLS do Rio esta muito sobrecarregada deste o inicio do dia impactando vários serviços.\r\n\r\nIdentificamos também que o trafego maior esta entre Rio e Curitiba partindo do servidor rjserver159 (Office Scan) para varias estações em CWB \r\n\r\nComo solução paliativa o servidor foi desligado conforme combinado com o responsável pelo mesmo.\r\n\r\n\r\nSegue a evidencia do trafego','Normalizado',23,1,5,3,'2013-07-12 18:24:42','2013-07-17 22:22:37',0,NULL,'','[Degradação MPLS rio de janeiro]',47,'',0,'Incidente',NULL,'',NULL,NULL),(805,'Devido a preparação para instalação do novo link da Cielo, toda a rede de Murano ficará indisponível no domingo, 14/07, das 20hs às 22hs.','Executado com Sucesso',6,1,5,11,'2013-07-12 19:45:01','2013-07-16 19:40:27',0,NULL,'','Manutenção Rede]',47,'',0,'Mudança',NULL,'',NULL,NULL),(806,'Área responsável realizando as devidas verificações relacionado ao licenciamento dos servidores dedicados ao VDI Itaú.','Normalizado',23,1,4,1,'2013-07-15 14:33:35','2013-07-23 20:24:03',0,NULL,'','[Instabilidade] VDI Itaú.',47,'',0,'Incidente',NULL,'Realizado reparo nos servidores com problemas de licença, aplicação continua em análise.',NULL,NULL),(807,'Notificado ao suporte local de BV.','Resolvido',23,1,4,5,'2013-07-15 14:43:48','2013-07-17 22:21:16',0,NULL,'','[Alerta] Wireless.BV.3 - 2º Andar.central',47,'',0,'Incidente',NULL,'',NULL,NULL),(808,'Servidor apresentando 5% livre. Notificada a área responsável.\r\n','Aberto',1,1,4,2,'2013-07-15 15:47:01','2013-07-16 19:56:24',0,NULL,'','[Alerta] spserver248.Book.Financenceiro.Disco.D',47,'',0,'Info',NULL,'',NULL,NULL),(809,'Estamos recebendo reclamações