NULL,'','[Manutenção Rede VO]',47,'',0,'Mudança',NULL,'Os seguintes links ficaram faltando ser recuados:\r\n\r\nLink Cielo\r\nLink Citibank\r\nTelfonia\r\n\r\nUma nova janela será agendada',NULL,NULL),(813,'16:00hrs Serviço de Internet normalizado, ocorreu um erro de configuração na própria operadora.\r\n\r\n15:03Hs - Feedback - A engenharia da GVT já está trabalhando para resolver o problema, não foi informado prazo.\r\n-----------------------------------------------------------\r\n14:48Hs - Falha massiva constatada e o gerente de contas foi acionado.\r\n\r\nAguardamos feedback do mesmo.\r\n-----------------------------------------------------------\r\n14:11Hs - Estamos recebendo alguns alertas relativos ao Link Gmail GVT.\r\n\r\nJá estamos em contato com a operadora analisando o link.','Resolvido',23,1,4,4,'2013-07-17 17:32:16','2013-07-22 17:28:25',0,NULL,'','[Serviço Internet Marechal/Kennedy]',4,'',1,'Incidente',NULL,'',NULL,NULL),(814,'E-mail notificando a área responsável:\r\n\r\nEstamos recebendo dois alertas em nosso painel de monitoração, todos os nossos links estão operando em sua normalidade.\r\n\r\nO ambiente Cielo está sofrendo impacto neste momento? Conseguimos um canal direto para interação relacionado aos servidores da própria Cielo?\r\n\r\nVIS.Cielo - Via Murano   Host: 10.50.52.51 Port: 1433\r\n\r\nMainframe SEC.Homologação 1.Cielo - Via Murano   Host: 10.90.7.122  Port 992','Resolvido',23,1,4,11,'2013-07-18 11:51:59','2013-07-23 20:23:25',0,NULL,'','[Alarmes] Vis.Cielo / Mainframe Sec. Homologação',47,'',0,'Info',NULL,'Problema de configuração, falta de rotas na localidade; ',NULL,NULL),(815,'Manutenção no SAP Produção para ajustes de bkp via sqlserver \r\n\r\nA manutenção acontecerá HOJE das 20hs às 21:30 ','Executado com Sucesso',2,1,5,1,'2013-07-18 17:23:45','2013-07-22 13:40:34',0,NULL,'','[Manutenção SAP Produção]',47,'',0,'Info',NULL,'',NULL,NULL),(816,'19/07/2013 \r\nRealizei o contato junto a operadora e após análise, recebi o retorno que o nosso circuito foi afetado por uma degradação de fibra.\r\n\r\nIncidente gerado devido a uma falha no backbone da level (3) entre SP e Rio, como o circuito da BRQ possuí proteção, ocorreu uma conversão para outro Anel causando uma oscilação momentânea, porém mantendo o nosso serviço disponível.\r\n\r\n\r\n\r\n-Hoje pela manhã sofremos com uma oscilação no link de MPLS entre 10:40 as 10:50h.\r\nEstamos com um chamado aberto junto a operadora, foi identificada uma oscilação, estamos no aguardo da análise dos logs.','Resolvido',23,1,4,2,'2013-07-18 19:12:39','2013-07-23 20:25:51',0,NULL,'','[Incidente] Oscilação MPLS.',23,'6818640',1,'Incidente',NULL,'servicedesknmpt por  brq.com \r\n18:12 (17 minutos atrás)\r\n\r\npara ale, noc, nsantos, djunqueira, leandrocaron, dc, Bruno, Jacquelline, Mauricio \r\nPrezado cliente,\r\n \r\nDetectamos um alerta e efetuamos a abertura de um incidente para a localidade BRQ - São Paulo - Dados:\r\n \r\nINCIDENTE:  6818640\r\nRESUMO:  Cliente solicita RFO para período de indisponibilidade observado em 18/07/2013 por volta das 10:30 hs\r\nSERVIÇO: MPLS\r\nDESIGNAÇÃO: P17059\r\nSINTOMA:  Indisponibilidade de serviço no período citado acima impactando produtividade de usuários.\r\nAFETAÇÃO: Disponível no momento.\r\nSEVERIDADE/IMPACTO:  ALTA\r\nPRIORIDADE:  ALTA\r\nAÇÃO/INFORMAÇÃO:  Incidente encaminhado ao time de Assurance Level 3 para averiguação.\r\n \r\nEm caso de dúvidas, favor entrar em contato com nossa central através do 0800-772-4266 ou pelo e-mail servicedesknmpt@level3.com\r\n \r\nThanks/ Saludos Cordiales / Atenciosamente,',NULL,NULL),(817,'Migração do Riverbed da Vila do DC 6º para o Mini-DC no 3º','Resolvido',1,1,5,2,'2013-07-18 19:14:02','2013-07-22 15:12:57',0,NULL,'','Shutdwn no Riverbed de Vila (16:18)',47,'',0,'Mudança',NULL,'',NULL,NULL),(818,'Re-ativar o Riverbed em Vila pós mudança da MPLS do 6º para o 3º\r\n\r\nDeve gerar uma pequena oscilação na MPLS de Vila','Executado com Sucesso',1,1,4,2,'2013-07-18 21:17:19','2013-07-22 13:40:44',0,NULL,'','[MPLS VILA] Mudar cabo para Riverbed (19hrs)',47,'',0,'Mudança',NULL,'',NULL,NULL),(819,'\r\n\r\n14:15 - Um Técnico foi enviado para análise do armário da GVT, caso necessário procederá até o local da instalação para verificação.\r\n------------------------------------------------------------\r\n\r\nIncidente ocorreu por volta das 11:00h.\r\nReincidente às 17:00h\r\n\r\nLink normalizado, continuaremos monitorando.','Resolvido',23,1,1,1,'2013-07-18 22:06:44','2013-07-22 17:31:13',0,NULL,'','[Incidente] Falha Massiva Internet Natal - RN',47,'180720134680972 170720133890178 190720135218130   190720135314547',0,'Incidente',NULL,'19/07/13 15:44\r\n\r\nEntramos em contato junto a GVT e recebemos o retorno que o técnico local estava em campo para realizar as devidas verificações no armário.\r\n\r\nNeste momento entrei em contato com o Analista Ricardo Leão e o Link está operando em sua normalidade, ainda não possuímos um retorno da operadora informando a normalização definitiva do serviço.\r\n\r\nQualquer eventualidade favor nos informar.\r\n\r\nSeguiremos acompanhando este incidente.\r\n\r\n------------------------\r\n<ricardoleao@brq.com>\r\n\r\nAdson,\r\n \r\nRealizei contato com a GVT e me informaram que foi reaberto o chamado para a visita técnica, repassaram o prazo de 24H e especificaram a urgencia por se tratar de empresa e não ter sido atendido pelo chamado anterior.',NULL,NULL),(820,'Pessoal,\r\n\r\nO Danilo me informou que algumas maquinas de Vargas estavam pegando IP na rede 10.2.108 percebi que o serviço DHCP do novo SQUIDVARGAS estava no ativo.. Parei o Serviço DHCP neste do novo SQUID e as maquinas voltaram a pegar IP na rede 10.2.16.0/21.\r\n\r\nPara os usuários que enfrentarem este problema devemos orienta-los a reiniciar o desktop.','Resolvido',23,1,4,3,'2013-07-19 13:00:27','2013-07-23 20:26:41',0,NULL,'','Gateway Máquinas Vargas.',47,'',0,'Incidente',NULL,'Prezados,\r\n\r\nBom dia,\r\n\r\nConforme conversamos, o Analista Hugo realizou uma análise no 8° andar e está se dirigindo ao 2° andar para ter uma métrica do impacto gerado, caso o número de chamados e ligações tenham um aumento significativo, favor informar o mais breve possível para que seja enviado um comunicado para localidade com as devidas orientações para os colaboradores..\r\n\r\nObs: As máquinas que não foram desligadas não sofreram impacto.\r\nPara os usuários que enfrentarem este problema devemos orienta-los a reiniciar o desktop.',NULL,NULL),(821,'Devido a substituição dos no-braks do 2º andar de BV, todo o  DC da localidade ficará off de 08hs às 12hs do próximo domingo. ','Executado com Sucesso',1,1,3,5,'2013-07-19 18:48:03','2013-07-22 18:43:52',0,NULL,'','[Manutenção no-break BV]',47,'',0,'Info',NULL,'',NULL,NULL),(822,'No domingo, 21/07, será realizada uma manutenção em alguns serviços em VO. Essa janela começará às 20hs e término às 05hs do dia 22/07. Segue abaixo, o que será impactado:\r\n\r\n• BRQ Vila Olímpia - Telefonia, Link Cielo e Citibank\r\n• BRQ Boa Vista - Telefonia;\r\n• BRQ Alphaville - Telefonia;\r\n• BRQ Curitiba - Telefonia;\r\n• BRQ Panamerica Park - Telefonia; \r\n• BRQ Murano - Telefonia e acesso a Cielo;\r\n• BRQ Brasília - Telefonia;\r\n• BRQ Fortaleza - Telefonia;\r\n• BRQ Vargas - Mainframe Citibank. O mesmo poderá ser acessado remotamente pelos usuários que\r\ntenham o RemoteOffice.','Executado com Sucesso',6,1,3,2,'2013-07-19 18:51:50','2013-07-23 13:29:46',0,NULL,'','[Manutenção Rede VO]',47,'',0,'Mudança',NULL,'Links E1, Cielo e Citibank foram movidos para o andar do mini-dc.',NULL,NULL),(823,'Hoje, os seguintes servidores Notes serão desligados:\r\n\r\nNOTESNG, DOMINOSP1, SPSERVER2','Cancelado',2,1,5,1,'2013-07-19 18:58:37','2013-07-22 13:46:31',0,NULL,'','[Desligamento servidores Notes]',47,'',0,'Info',NULL,'Mudança não pode ser realizada, pois foi verificado que o SI e as impressoras estavam utilizando os servidores Notes que iriam ser desligados como SMTP server.\r\n\r\n',NULL,NULL),(824,'Migração dos No-breaks do DC em BV','Executado com Sucesso',1,1,3,5,'2013-07-21 10:56:19','2013-07-22 18:43:36',0,NULL,'','PARADA DC BV - 08 AS 12HRS (21/07)',47,'',0,'Mudança',NULL,'',NULL,NULL),(825,'Problemas na localidade, aguardando análise da área responsável.','Resolvido',23,1,4,5,'2013-07-22 18:05:42','2013-08-05 15:21:19',0,NULL,'','[Análise Ambiente Boa Vista]',47,'',0,'Incidente',NULL,'Network Operation Center <noc@brq.com>\r\n16:47 (2 horas atrás)\r\n\r\npara servicedesk, suportebrq, telefonia, dc \r\nPrezados,\r\n\r\nBoa Tarde,\r\n\r\nO Incidente ocorreu devido a uma falha elétrica causada por uma tomada queimada do No Break, impactando todos os serviços da localidade.\r\nTempo de indisponibilidade do Site: 15:00hrs – 15:25hrs.\r\n\r\n*Devido a migração dos No Breaks para o 6° andar, o DC está atuando apenas com um temporariamente.\r\n',NULL,NULL),(826,'-\r\nPrezados, o serviço voltou a operar em sua normalidade as 09:25hrs. Continuamos interagindo junto ao Gerente de contas buscando a descrição da solução.\r\n\r\nEsta falha foi identificada hoje em nosso check-list de Telefonia realizado às 07:00hrs, o chamado já foi aberto junto a nossa mantenedora.','Resolvido',23,1,5,7,'2013-07-23 12:17:55','2013-08-05 15:22:04',0,NULL,'','[Incidente] Falha massiva 0800 CEF',4,'16439',1,'Incidente',NULL,'Bom dia, Senhores Estamos com os serviços abaixo indisponíveis. Necessito da verificação urgente junto a operadora. 08000815121 -> CNPJ -> 36542025000830 \r\n08006008002 -> CNPJ -> 36542025000164 \r\n\r\nAté o momento não recebemos nenhuma descrição da solução do problema.',NULL,NULL),(827,'Links Normalizados às 11:20h, continuamos interagindo junto a operadora em busca da descrição da solução.\r\n\r\nEstamos com uma inidisponibilidade em 2 links da GVT em Marechal. \r\n\r\nOs links são a MPLS e o link de Internet dedicado (10 MB).\r\n\r\nNeste momento estamos operando via VPN automatica.\r\n\r\nA VPN com o itaú esta off devido ao problema e já orientamos as