link segue em monitoração e não apresentou mais nenhuma indisponibilidade.\r\n\r\n\r\n\r\n13/08/2013 - Reincidente com o nosso Link de Internet GVT, estamos utilizando a contingência, solicitado o envio de um comunicado para toda BRQ relacionado ao impacto gerado a alguns serviços acessados de fora da BRQ.\r\n\r\n13/08/2013 - O Link voltou a operar em sua normalidade, recebemos o feedback da operadora em relação a um rompimento de fibra na região de São Paulo causando uma falha massiva.\r\n','Resolvido',23,1,5,5,'2013-08-09 18:55:23','2013-08-15 18:24:51',0,NULL,'','Instabilidade Link Internet Boa Vista.',4,'899038201308091553 902406201308131214',1,'Incidente',NULL,'O Link voltou a operar em sua normalidade, recebemos o feedback da operadora em relação a um rompimento de fibra na região de São Paulo causando uma falha massiva.\r\n\r\nDurante o período de indisponibilidade a contingência foi ativada, porém gerando impacto em relação a alguns acessos realizados de fora da BRQ.\r\nServiços: www.brq.com, https://citrix.brq.com, jira.brq.com, vpnsp.brq.com.   \r\n* A Contingência foi desativada e todos os serviços foram restabelecidos.',NULL,NULL),(864,'Cabo uplink do 6º andar, será recuado para o 3º andar','Aberto',17,1,1,2,'2013-08-09 19:06:13','2013-08-12 12:35:36',0,NULL,'','[Virada de uplink dos switches]',47,'',0,'Mudança',NULL,'',NULL,NULL),(865,'Caso o colaborador entre em contato informando estar sem acesso ao diretório Publico, favor orientar o mesmo a realizar logoff/Logon.\r\n','Aberto',23,1,5,2,'2013-08-12 12:36:58','2013-08-15 18:22:46',0,NULL,'','Acesso ao diretório Publico em VO',47,'',1,'Info',NULL,'O Spserver1 estava desligado, por conta disto quem fez logon hoje pela manhã não mapeou o Publico.',NULL,NULL),(866,'Área responsável verificando lentidão para completar as ligações.\r\n\r\nFoi identificado um problema de configuração relacionado ao tamanho máximo da tabela MAC do Gateway de BV, gerando dificuldade de \"chegar\" a outra localidade.\r\n\r\nPara resolver, aumentamos o limite máximo desta tabela. \r\n\r\nO ambiente continua em monitoração.','Resolvido',23,1,5,5,'2013-08-12 13:39:38','2013-08-16 15:40:06',0,NULL,'','Lentidão Telefonia para completar ligacoes',47,'',1,'Incidente',NULL,'Nelys David dos Santos:\r\n\r\nHoje pela manha, tivemos alguns eventos \"estranhos\" em Boa Vista.\r\nComeçou com alguns telefones não funcionado.\r\nNa verdade, foi o Firewall que estava incapaz de adicionar mais MAC-ADDRESS em sua tabela ARP.\r\nDesta forma ele simplesmente \"ignorava\" algumas máquinas na rede.\r\nAs máquinas que já estavam na tabela, continuavam funcionando e as que ficam em \"silêncio\" por muito tempo não conseguiam mais sair da da sua própria rede.\r\nO problema, aparentemente foi resolvido, mais ainda estamos monitorando.\r\nA resolução está em:\r\nhttp://jira.brq.com/browse/INFR-3177',NULL,NULL),(867,'Erro para executar as aplicações do Citrix.\r\n\r\n- Unable to launch your application.\r\n- Error: Login exceeds maximum allowed users.\r\n\r\nÁrea responsável está atuando na solução do problema.\r\n\r\n13/08/2013 - O acesso as aplicações do Citrix foram restabelecidas o operam normalmente.','Resolvido',23,1,5,1,'2013-08-12 14:41:21','2013-08-15 18:26:37',0,NULL,'','Erro Ambiente Citrix.',47,'',1,'Incidente',NULL,'Acionado Analista Citrix, aguardando chegada do mesmo a BRQ.',NULL,NULL),(868,'Chamado relacionado ao aumento de disco do servidor 073354.\r\nMaquina será desligada para o processo do aumento do disco.','Resolvido',31,1,5,9,'2013-08-12 20:23:27','2013-08-15 18:27:24',0,NULL,'','[Servidor ppserver7]',47,'073354',0,'Info',NULL,'Efetuada a expansão do disco conforme solicitado no chamado 073354. ',NULL,NULL),(869,'Olá,\r\n\r\nInformamos que HOJE, 12 de agosto, será realizada uma manutenção elétrica emergencial na \r\nBRQ Marechal, das 22hs às 22:40h.\r\n\r\nEm função disso, os seguintes serviços ficarão indisponíveis nesse período: acesso à internet, \r\nclientes, e-mail, telefonia, VPN e outros.\r\n\r\nO Data Center também ficará indisponível e não haverá acessos originados ou recebidos \r\npara a BRQ Marechal.\r\n\r\nOBS: Devido a falta de energia elétrica, desligue o seu equipamento para evitar danos e perda de dados. \r\n\r\nEm caso de dúvidas, entre em contato pelo e-mail servicedesk@brq.com.','Executado com Sucesso',23,1,5,4,'2013-08-12 22:11:25','2013-08-13 17:52:34',0,NULL,'','Manutenção elétrica emergencial, 22hs às 22:40hs.',47,'',1,'Mudança',NULL,'DC não precisou ser desligado, os nobreaks aguentaram todo o período da atividade. Atividade esta que durou 30min.\r\n\r\n',NULL,NULL),(870,'Identificamos oscilações na MPLS de Boa Vista. Foi aberto um chamado junto a operadora para que seja efetuada a análise. \r\n\r\n\r\nConfiguração realizada pela operadora eliminando o problema de perda de pacotes. Link operando normalmente. \r\n\r\n','Resolvido',23,1,5,5,'2013-08-13 19:47:20','2013-08-19 18:21:05',0,NULL,'','[Perda de pacotes] MPLS BOA VISTA',23,'6902251',0,'Incidente',NULL,'INCIDENTE:  6902251\r\nRESUMO: Perda de pacotes\r\nSERVIÇO: MPLS.\r\nDESIGNAÇÃO: P16288\r\nTECNOLOGIA DE FALHA: Cisco 1841\r\nSINTOMA: Queda de conexão\r\nAFETAÇÃO: Localidade indisponível\r\nSEVERIDADE/IMPACTO: CRÍTICO\r\nPRIORIDADE: ALTA\r\nAÇÃO: Detectamos perdas de pacotes entre o router CPE e o Edge.\r\n',NULL,NULL),(871,'Estamos em contato junto a operadora realizando as devidas verificações em nosso Link.  Prazo de retorno do contato entre 30 - 40 minutos.\r\nManteremos todos informados.\r\n\r\nAlerta: Cielo Detectado: 15/08/13  10:14:42 hrs.\r\n\r\n15/08/2013 13:18 - Continuamos interagindo junto a operadora, recebemos o retorno que a mesma está passando por uma falha massiva afetando as regiões de SP e RJ, o chamado foi escalonado e continuaremos acompanhando este incidente.\r\n\r\n15/08/2013 14:34 -  O circuito não está mais down e sim com perda de pacotes, erros de CRC e com 30 ruídos por minuto. Solicitado urgência para a operadora.\r\n\r\n16/08/2013 01:59 - Efetuada a manutenção pela operadora no link com sucesso\r\n\r\n16/08/2013 09:00 - Link operacional\r\n\r\n','Resolvido',28,10,5,1,'2013-08-15 13:23:11','2013-08-19 18:21:39',0,NULL,'','[Incidente] Indisponibilidade Ambiente CIELO',23,'6909254',1,'Incidente',NULL,'',NULL,NULL),(872,'Atualização do ESX para versão 5.0','Executado com Sucesso',7,1,4,3,'2013-08-15 14:34:12','2013-08-19 17:46:11',0,NULL,'','Manutenção RJSRVESX246',35,'',0,'Mudança',NULL,'',NULL,NULL),(873,'O Link dedicado ao Google na localidade de Vila Olímpia apresentou falha as 15:30hrs, as rotas foram alteradas e no momento os sites da Google estão saindo pela link da Level(3).\r\n\r\nRealizamos o contato junto a operadora e o chamado: 907003201308151549 foi registrado com o prazo de retorno para contato de 4 horas.\r\n\r\nConforme contato com a operadora o link já esta normalizado. ','Resolvido',23,1,5,2,'2013-08-15 18:45:02','2013-08-19 18:23:36',0,NULL,'','Link.Sites.Google.VO',4,'907003201308151549',1,'Incidente',NULL,'',NULL,NULL),(874,'Foi verificado pela Columbia, que a versão do SO do Acc que está em VIla, é diferente dos demais. \r\n\r\nPor isso foi agendada essa atualização.\r\n\r\nAtividade em conjunto com Nelys, Edson e Mansur.\r\n\r\nPeriodo: 20hs às 22hs\r\n\r\nImpacto: pequena oscilação na MPLS da localidade','Executado com Sucesso',2,1,5,2,'2013-08-15 20:24:12','2013-08-19 13:45:36',0,NULL,'','[Atualização do Acelerador de Wan]',47,'',0,'Mudança',NULL,'Acelerador foi atualizado. \r\n\r\nPorém no dia seguinte, o mesmo erro de autenticação voltou a ocorrer pela 3ª vez.\r\n\r\nCarlinhos aplicou uma regra no acc para resolução do problema.',NULL,NULL),(875,'ativação da interface da rede do storage de BV\r\n\r\nHorario: 19hs\r\n\r\nImpacto: oscilação na rede da localidade','Resolvido',1,1,5,5,'2013-08-15 20:26:31','2013-08-19 17:48:43',0,NULL,'','[Ativação interface storage]',47,'',0,'Mudança',NULL,'Atividade será executada hoje, 16/08, às 20hs.\r\n\r\nPara ativação da interface, foi negociado 