s e o ambiente continua em monitoração.\r\n\r\n21/08/2013 - 08:40 - Realizados testes com sucesso, será efetuado outro teste no período da tarde.\r\n\r\nBRQ Marechal - Manutenção Telefonia, HOJE, 20hs às 21hs\r\n\r\n21/08/2013 - 13:47 - Foi habilitada uma rota de contingência no site de Marechal para a realizações de ligações externas. Esta já está ativa, e sua utilização é totalmente transparente ao usuário. \r\n\r\n26/08/2013 - Mantenedora - Foram realizadas novas configurações, continuamos acompanhando as alterações.\r\n\r\n27/08/2013 - Conforme informado pela equipe de telefonia o ambiente continua em monitoração\r\n\r\n27/08/2013 - Será realizada uma monitoração pela  mantenedora a partir das 15 horas para verificação do  ambiente. As 16 horas realizaremos uma conferência entre a mantenedora e a operadora para trabalharmos em cima dos resultados desta monitoração.\r\n\r\n28/08/2013 - 08:00 - Após manutenção realizada o ambiente retornou a normalidade.\r\n','Executado com Sucesso',23,1,5,4,'2013-08-16 16:14:52','2013-08-30 13:41:45',0,NULL,'','[Análise] Ligações Saintes Marechal.',5,'16668 910271201308191213 ',1,'Incidente',NULL,'Chamado 910271201308191213 aberto na operadora GVT para verificar o link. Este encontra-se em observação pela mesma.\r\n\r\nChamado InstantTicket 16668 - Ramais pontuais indisponíveis, ambiente em monitoração.\r\n\r\nCíntia Pesse Ribas (responsável pela GVT) foi acionada.\r\n\r\n20/08/2013 - 17:45 - Conforme comunicado da GVT,foi efetuada a troca de um dos modems e o ambiente continua em monitoração\r\n\r\n21/08/2013 - 08:40 - Realizado teste com a colaboradora Juliana da recepção (ramal 418002) para ligação externa com sucesso.Será efetuado outro teste no período da tarde.\r\n\r\n21/08/2013 - 13:47 - Foi habilitada uma rota de contingência no site de Marechal para a realizações de ligações externas. Esta já está ativa, e sua utilização é totalmente transparente ao usuário. \r\n\r\n26/08/2013 - Mantenedora - Caros solicitei ao Flavio que fizesse alteração na porta do Swtchi que esta conectado o Media Gateway de Automático para 100MB Full-duplex, após horário comercial.  Até o presente momento não foi reclamado com o Thiago quedas e não conseguir completar chamadas para fora após às 16 horas.  \r\n',NULL,NULL),(881,'Foram verificados alguns erros nos pontos de rede em Marechal. \r\nPara os colaboradores que entrarem em contato favor repassar o chamado para a localidade de Marechal.\r\n\r\nNão foram mais relatados problemas nos pontos de rede. Ambiente estável.','Resolvido',23,1,5,4,'2013-08-19 13:51:16','2013-08-23 19:30:53',0,NULL,'','[Incidente] Problemas pontuais em pontos de rede - Marechal ',47,'',1,'Info',NULL,'',NULL,NULL),(882,'Informo que o chamado foi aberto junto a Level(3): 6928807, prazo de retorno para contato de uma hora.\r\n18:40 h - No momento o Alerta não está mais em alarme, aguardando retorno da operadora.\r\n19:40 h - O serviço encontra-se disponível novamente. foi efetuada um manutenção na rede de fibra óptica.','Resolvido',23,1,5,8,'2013-08-20 20:57:34','2013-08-23 19:29:43',0,NULL,'','[Indisponibilidade MPLS] C.FORMPLSROUTER.LAN0',23,'6928807',0,'Incidente',NULL,'A interrupção do serviço estava relacionada a um rompimento de fibra na rede da last mile Oi.',NULL,NULL),(883,'Hoje será realizada uma manutenção no RM e o sistema ficará fora do ar entre 19h e 20h.\r\n\r\n22-08-2013 - 09:38 - Verificado com o pessoal do DP-RJ e o sistema ainda esta instável pelo acesso ao citrix.\r\n\r\n22-08-2013 - 14:44 - Verificado com o pessoal do DP-RJ e o sistema esta operacional.','Nao Resolvido',23,1,5,1,'2013-08-21 17:30:13','2013-08-23 17:36:00',0,NULL,'','[Manutenção RM]',19,'',1,'Info',NULL,'Mudança não foi realizada, pois deu erro de licença no servidor de SP.\r\n\r\nSerá aberto um chamado na TOTVS, para verificação do erro.\r\n\r\nAssim que possível, marcaremos uma nova data.',NULL,NULL),(884,'Devido aos problemas em relação a ligação sainte que vem ocorrendo na localidade, a GVT precisa realizar uma manutenção na rede para identificar o problema.\r\n\r\nEssa manutenção será realizada hoje, entre 20hs e 21hs. Durante esse período, pequenos periodos de indisponibilidade podem ser apresentadas.\r\n\r\n27/08/2013 - 16:00 - O problema persiste, esta sendo tratado no alerta :  Nome do Evento: [Análise] Ligações Saintes Marechal.','Resolvido',15,1,5,4,'2013-08-21 18:29:32','2013-08-29 13:44:31',0,NULL,'','[Manutenção telefonia Marechal]',4,'',0,'Info',NULL,'Nenhum problema foi encontrado pela equipe tecnica da GVT.\r\nA mesma informou que o problema seria interno.\r\n\r\nFoi agendada uma audioconfêrencia entre GVT, Instant e BRQ.\r\n\r\n----------------------xxxx---------------------------------\r\n\r\nFoi identificado pela GVT, que em um dos canais de voz de um dos E1’s estava travado. Após o destravamento, o link voltou a operar na sua normalidade.\r\n',NULL,NULL),(885,'Estamos com uma falha de telefonia/dados em Natal. Ligações originadas para o 0800 (SD - Neoenergia) também não estão sendo completadas, retornando sinal de ocupado.\r\n\r\n21/08/2013 - 15:44 - verificado com  Ricardo Dos Santos Leão Junior que o ambiente neste instante esta estável. \r\n\r\n22/08/2013 - 09:17 - verificado com  Ricardo Dos Santos Leão Junior que o ambiente neste instante esta estável.Faremos uma nova verificação na parte da tarde para validar o ambiente. \r\n\r\n22/08/2013 - 16:55 - verificado com  Ricardo Dos Santos Leão Junior que o ambiente neste instante esta estável.Porém tivemos uma instabilidade com duração de 10 minutos no período da tarde \r\n\r\n23/08/2013 - 10:00 - verificado com  Ricardo Dos Santos Leão Junior que o ambiente neste instante esta estável. Faremos uma nova verificação na parte da tarde para validar o ambiente. \r\n\r\n23/08/2013 - 15:20 - verificado com  Ricardo Dos Santos Leão Junior que o ambiente neste instante esta estável. O ambiente continua em monitoração.\r\n\r\n26/08/2013 - 13:48 - Aberto chamado 260820137658980 para verificar as i