\n\r\n27/08/2013 - 16:00 - Não tivemos mais instabilidade neste link. Permaneceremos em monitoração.','Resolvido',23,2,5,2,'2013-08-27 11:13:32','2013-08-30 13:44:54',0,NULL,'','Link ponto a ponto VO x Bradesco',23,'6946885',1,'Incidente',NULL,'',NULL,NULL),(891,'28/08/2013 - Foi verificada falha massiva na MPLS de Fortaleza \r\nAberto o chamado n° 6951300 as 10:42h. Prazo de retorno 4 horas\r\n28/08/2013 - Foi ativada a contingência. \r\n28/08/2013 - Conforme informações da operadora a previsão para recuperação do link esta prevista para as 17:00 horas de hoje.\r\n\r\n29/08/2013 - Efetuada a manutenção do link pela operadora. Aguardando testes dos técnicos para validar o ambiente.\r\n\r\n29/08/2013 - Testes efetuados com sucesso, a MPLS de Fortaleza encontra-se operacional.','Normalizado',23,1,5,8,'2013-08-28 14:06:00','2013-09-03 21:16:56',0,NULL,'','[Hostmonitor] C.FORMPLSROUTER.LAN0',23,'6951300',1,'Incidente',NULL,'28/08/2013 - A interrupção de serviço observada está relacionada a uma falha massiva entre Juquitiba e Juquiá (BB # 6951343).\r\n\r\n28/08/2013 - Estamos passando por uma queda geral de energia na região nordeste. As localidades de Fortaleza e Recife estão operando por contingência \"Nobreak\" e Natal encontra-se inoperante. \r\nNoticia da imprensa - http://g1.globo.com/pernambuco/noticia/2013/08/chesf-confirma-queda-de-energia-no-nordeste.html\r\n',NULL,NULL),(892,'28/08/2013 - Estamos passando por uma queda geral de energia na região nordeste. As localidades de Fortaleza e Recife estão operando por contingência \"Nobreak\" e Natal encontra-se inoperante. \r\nNoticia da imprensa - http://g1.globo.com/pernambuco/noticia/2013/08/chesf-confirma-queda-de-energia-no-nordeste.html\r\n28/08/2013 - 17:30 - Energia restabelecida em Fortaleza\r\n28/08/2013 - 17:00 - Energia restabelecida em Recife\r\n29/08/2013 - 09:00 - Energia restabelecida em Natal \r\n\r\n29/08/2013 - Todas as localidades do Nordeste operando normalmente.','Resolvido',23,12,5,1,'2013-08-28 18:50:46','2013-08-30 13:48:09',0,NULL,'','[Incidente]Falha massiva na energia na região do Nordeste',47,'',1,'Incidente',NULL,'',NULL,NULL),(893,'28/08/2013 - Estamos com o link de internet indisponível no site de Vargas.\r\n28/08/2013 - Foi acionada a contingência. \r\n28/08/2013 - Informamos que a internet da localidade Vargas voltou a operar em sua normalidade as 18:00h. O problema foi identificado no roteador da operadora, sendo necessária a troca do mesmo.\r\n29/08/2013 - A internet funciona normalmente na localidade Vargas.\r\n','Resolvido',23,1,5,3,'2013-08-28 19:11:17','2013-08-30 13:48:48',0,NULL,'','[Internet Vargas] Atuando pela Contingência.',9,'1308281616194804 ',1,'Incidente',NULL,'Informamos que a internet da localidade Vargas voltou a operar em sua normalidade as 18:00h. O problema foi identificado no roteador da operadora, sendo necessária a troca do mesmo..\r\n\r\nContinuaremos monitorando o link.\r\n\r\n-----------------------\r\n\r\nEstamos passando por uma indisponibilidade no link de internet dedicado da Mundivox,  na localidade Vargas. As rotas de internet foram alteradas para o link GC Level (3) como contingência. Estamos em contato junto a operadora, está sendo direcionado um Técnico para analisar todos os equipamentos com o prazo de duas horas, podendo ser antecipado.\r\nPrecisamos agendar uma janela de mudança, para que sejam realizados novos testes relacionados ao desvio de rotas automático no HostMonitor, hoje o processo foi realizado manualmente.\r\nAlerta criado em nossa console para acompanhamento.\r\nChamado Mundivox: 1308281616194804.\r\nManteremos todos informados.',NULL,NULL),(894,'Hoje , das 22hs às 22:30hs será realizado uma manutenção no Media Gateway de Boa Vista para instalação de uma nova placa E1.\r\n\r\nDurante esse período, as ligações entrantes e saintes ficarão indisponíveis.','Executado com Sucesso',6,1,3,5,'2013-08-28 19:20:25','2013-08-30 13:47:14',0,NULL,'','[Manutenção telefonia Boa Vista]',5,'',0,'Mudança',NULL