09\r\nO problema com o Gmail deverá ser resolvido. Pedimos desculpas pelo transtorno e agradecemos a sua paciência e o seu apoio.','Normalizado',23,1,5,1,'2013-09-25 20:57:43','2013-09-27 12:35:37',0,NULL,'','[Instabilidade] Google Mail.',30,'',1,'Mudança',NULL,'',NULL,NULL),(955,'A operadora GVT está com uma falha massiva na região de Recife desde as 08:00hrs , impactando todos os links de voz. Foi aberto o chamado 963905201309260846, com previsão para primeiro contato as 10:0hrs\r\n\r\nSituação normalizada as 09:29 conforme informações do analista Glauber. \r\n\r\nConforme informação da operadora houve um erro de configuração na  rede interna da GVT ocasionando a falha massiva na região, após efetuarem ajustes o ambiente foi normalizado. \r\n\r\n30/09/2013 - O Link de Internet está indisponível mais uma vez gerando impacto ao site de Recife, o número GVT 0800 está com o sinal de ocupado impossibilitando a abertura de um chamado.Gestora GVT já acionada.\r\n\r\n30/09/2013 - Estamos com uma indisponibilidade relacionada ao link GVT identificada as 11:40h, afetando os serviços de internet e o 0800 NeoEnergia, já escalonamos a situação junto a Gerente de Contas. Será realizado um novo contato as 13:00h.','Normalizado',23,12,5,10,'2013-09-26 12:33:54','2013-10-10 18:48:04',0,NULL,'','[Reincidente]Falha massiva no Recife',4,'963905201309260846',1,'Incidente',NULL,'Chamado aberto em 27/09/2013 solicitando o relatório técnico - 967191201309271523 - prazo 48 horas. ',71,NULL),(956,'26/09/13 05:32\r\nEstamos investigando relatos de um problema com o Google Talk. Forneceremos mais informações em breve.\r\n\r\n26/09/13 11:15\r\nEstamos investigando este problema. Forneceremos uma atualização às 26/09/13 13:00 com detalhes sobre quando o problema deve ser resolvido.\r\n\r\n26/09/13 15:35\r\nO serviço do Google Talk já foi restaurado para alguns usuários e esperamos uma resolução para todos os usuários em breve. Este período é apenas uma estimativa e pode sofrer alterações.','No