ncia.\r\n\r\n_________________________________________________________\r\n\r\nManutenção efetuada com sucesso.\r\n','Resolvido',23,3,5,7,'2013-10-16 14:44:30','2013-10-22 17:32:29',0,NULL,'','Link Lan-to-Lan Copel - BRQ > HSBC 4',57,'1306',1,'Info',NULL,'',943,NULL),(988,'Link Indisponível. Início:14:10h Realizando abertura de chamado junto a operadora.\r\nSite atuando via contingência.\r\n_________________________________________________________\r\nDe acordo com informações da operadora, foi realizado um reparo na rede de fibra óptica normalizando o ambiente.\r\nTestes de acesso realizados pelos analistas Flavio e Marcos efetuados com sucesso.\r\nTempo de indisponibilidade: 14h:20m – 16h:00m\r\n\r\nContinuaremos interagindo junto a mesma. ','Normalizado',23,21,5,12,'2013-10-17 17:53:15','2013-10-22 17:23:51',0,NULL,'','Link MPLS GVT - BRQ',4,'999481201310171453',1,'Incidente',NULL,'',598,NULL),(989,'Boa tarde,\r\n\r\nEntramos em contato junto a operadora GVT, a mesma está com uma falha massiva - rompimento de fibra na região de CWB.\r\n\r\nImpactos : \r\n\r\nBrasília / Panamérica Park não acessa SVN em Marechal.\r\n\r\nMarechal não acessa VPN Caixa em BSB.\r\n\r\nInicio do incidente : 14h:20m de hoje \r\n\r\nFoi aberto um chamado para a falha massiva em CWB  na operadora com prazo de 4 horas para retorno\r\n\r\n_________________________________________________________\r\nDe acordo com informações da operadora, foi realizado um reparo na rede de fibra óptica normalizando o ambiente.\r\nTestes de acesso realizados pelos analistas Flavio e Marcos efetuados com sucesso.\r\nTempo de indisponibilidade: 14h:20m – 16h:00m\r\n\r\nContinuaremos interagindo junto a mesma. \r\n','Normalizado',23,21,5,4,'2013-10-17 18:42:40','2013-10-22 17:25:02',0,NULL,'','Link MPLS GVT - BRQ',4,' 99 99 53 2013 10 17 1619',1,'Incidente',NULL,'',590,NULL),(990,'Atualização para entrada do horário de verão.','Executado com Sucesso',27,1,5,6,'2013-10-17 19:30:49','2013-10-18 20:17:39',0,NULL,'htt